Balkon-Sitzecke Bank, Stuhl und Eckteil – einzeln oder in Kombination verwendbar. Aus hochwertigem Akazienholz FSC® 100%. Vorgeölt, daher wetterfest und widerstandsfähig. Beschläge verzinkt. Rechts- oder linksseitig zu montieren. Inkl. Montagematerial.

Akazienholz: Große Zähigkeit und Biegsamkeit machen Akazienholz zu einem perfekten Drechslerholz. Die elegante Farbe und individuelle Maserung machen jedes Stück zu einem Unikat.

FSC®-Warenzeichen: Mit dem FSC®-Warenzeichen werden Produkte ausgezeichnet, für deren Herstellung Holz aus vorbildlich bewirtschafteten Wäldern verwendet wird, unabhängig zertifiziert nach den strengen Richtlinien des FSC®.

Maße (B x H x T): Bank: Ca. 98 x 90 x 50 cm; 

Eckteil: Ca. 50 x 90 x 50 cm; 

Stuhl: Ca. 48 x 90 x 50 cm; 

Montiert: Ca. 148 x 90 x 98 cm; 

Sitzhöhe: Ca. 45 cm
